import styled from 'styled-components';
import EpicBackgroundPng from '../img/backgrounds/EpicBackground.png';

const DefaultBackground = styled.div`
  background: 
    linear-gradient(to bottom, rgba(30, 37, 56, 1), rgba(30, 37, 56, 0.5), rgba(30, 37, 56, 0.25), rgba(30, 37, 56, 0) 50%, rgba(30, 37, 56, 0.25), rgba(30, 37, 56, 0.5), rgba(30, 37, 56, 1)),
    linear-gradient(to left, rgba(30, 37, 56, 1), rgba(30, 37, 56, 0.5), rgba(30, 37, 56, 0.25), rgba(30, 37, 56, 0) 50%, rgba(30, 37, 56, 0.25), rgba(30, 37, 56, 0.5), rgba(30, 37, 56, 1)),
    url(${EpicBackgroundPng}) center/cover no-repeat;
`;

export default DefaultBackground;
